import React, { useEffect, useState } from 'react';
import './App.css';
import axios from 'axios';
import styled from 'styled-components';

function App() {
  const [temtem, setTemTem] = useState();
  useEffect( () => {
    axios.get(`https://temtem-api.mael.tech/api/temtems/[1]`)
    .then(res => {
      setTemTem(res.data)
      console.log(res)})
    .catch(err=> console.log('from app err', err) 
    )
  }, [])

  useEffect (()=> {
    axios.get('https://temtem-api.mael.tech/api/techniques')
    .then(res=> console.log('types', res))
  },[])

  if(!temtem){
    return <div>loading...</div>
  }
  return (
    <div className="App">
      {temtem.map(obj => {
        return (
          <div>
            <p>name: {obj.name}</p>
            <img src={obj.wikiPortraitUrlLarge}></img>
          </div>
        )})}
    </div>
  );
}

export default App;
